function ajaxCallback(n,t,i,o={}){$.ajax({url:n,method:t,data:o,dataType:"json",success:i,error:function(n){console.error(n.responseText)}})}$(document).ready(function(){$("#sidenav, #sidenavContent").hide(),$("#hamburgerMenu").click(function(n){n.preventDefault(),openSidenav()}),$("#sidenav").click(function(){closeSidenav()}),$("#sidenavContent").click(function(n){n.stopPropagation()});$(window).scrollTop()<=200&&$("#toTop").hide(),$("#toTop").click(function(n){n.preventDefault(),$(window).scrollTop(0)}),$(window).scroll(function(){$(window).scrollTop()>200?$("#toTop").fadeIn(200):$("#toTop").fadeOut(200)}),printCartQuantity()});const sidenavAnimationDuration=200;function openSidenav(){$("#sidenav").fadeIn(sidenavAnimationDuration,function(){$("#sidenavContent").animate({width:"toggle"},sidenavAnimationDuration)})}function closeSidenav(){$("#sidenavContent").animate({width:"toggle"},sidenavAnimationDuration,function(){$("#sidenav").fadeOut(sidenavAnimationDuration)})}function printCartQuantity(){ajaxCallback("models/cart/get-cart-quantity.php","GET",function(n){$("#cartQuantity").html(n)})}